import React from 'react';
import { element } from 'prop-types';
import { Box } from '@material-ui/core'
import Header from '../header'
import Footer from '../footer'

const Layout = ({ children }) => {
  
  return (<Box id="new">
      <Header />
      {children}
      <Footer />
  </Box>
)}

Layout.defaultProps = {};

Layout.propTypes = {
  children: element,
};

export default Layout;
